def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

def all_left_right_truncatable_prime(numbers):
    primes = []
    for x in numbers:
        if x < 23:
            continue
        for i in range(2, x):
            if not is_prime(i):
                continue
            num = str(i)
            if '0' in num:
                continue
            is_truncatable = True
            for j in range(1, len(num)):
                if not is_prime(int(num[j:])):
                    is_truncatable = False
                    break
            if is_truncatable:
                primes.append(i)
    return sorted(primes)
